@jaleelwhite is the latest celebrity to get in on the cannabis industry. White, who famously played Steve Urkel on the '90s sitcom 'Family Matters,' has partnered with 710 Labs for a new cannabis venture, ItsPurpl. Specifically, the business will offer its own variations on Purple Urkle (@purpleurkle), a strain of cannabis popular in California. ItsPurpl is set to launch on — when else? — 4/20.⁠
